const container = document.getElementById('container')
const canvas = document.getElementById('canvas')
const file = document.getElementById('fileUpload')

canvas.width = window.innerWidth
canvas.height = window.innerHeight
const ctx = canvas.getContext('2d')

let audioSrc
let analyser



const barAmountInput = document.getElementById('barAmountInput')

let barAmount = barAmountInput.value

barAmountInput.addEventListener('keyup', function() {
    let barAmount = barAmountInput.value
    if (!/[0-9]{1,4}/.test(barAmountInput.value)) {
        console.log(barAmount)
    }
    
})

container.addEventListener('click', function () {
    const audio = document.getElementById('audio')
    audio.src = 'data:audio/x-wav;base64,'
    const audioCtx = new AudioContext()

    audio.play()
    audioSrc = audioCtx.createMediaElementSource(audio)
    analyser = audioCtx.createAnalyser()
    audioSrc.connect(analyser)
    analyser.connect(audioCtx.destination)
    analyser.fftSize = 512 //Amount of audio bars
    const bufferLength = analyser.frequencyBinCount
    const dataArray = new Uint8Array(bufferLength)

    const barWidth = (canvas.width/2) / bufferLength
    let barHeight
    let x

    function animate() {
        x = 0
        ctx.clearRect(0, 0, canvas.width, canvas.height)
        analyser.getByteFrequencyData(dataArray)
        drawVisualizer(bufferLength, x, barWidth, barHeight, dataArray)

        requestAnimationFrame(animate)
    }
    animate()
})

file.addEventListener('change', function () {
    const files = this.files
    const audio = document.getElementById('audio')
    audio.src = URL.createObjectURL(files[0]) //Audio to text
    audio.load()
    audio.play()

    audioSrc = audioCtx.createMediaElementSource(audio)
    analyser = audioCtx.createAnalyser()
    audioSrc.connect(analyser)
    analyser.connect(audioCtx.destination)
    analyser.fftSize = 512
    const bufferLength = analyser.frequencyBinCount
    const dataArray = new Uint8Array(bufferLength)

    const barWidth = (canvas.width/2) / bufferLength
    let barHeight
    let x

    function animate() {
        x = 0
        ctx.clearRect(0, 0, canvas.width, canvas.height)
        analyser.getByteFrequencyData(dataArray)
        drawVisualizer(bufferLength, x, barWidth, barHeight, dataArray)

        requestAnimationFrame(animate)
    }
    animate()
})

function drawVisualizer(bufferLength, x, barWidth, barHeight, dataArray) {
    for (let i = 0; i < bufferLength; i++) {
        barHeight = dataArray[i] * 1.5
        ctx.save()
        ctx.translate(canvas.width/2, canvas.height/2) //Centerpoint to middle of screen
        ctx.rotate(i + Math.PI * 4 / bufferLength) //Rotate canvas
        //Identify colors
        const red = i * barHeight/20
        const green = i/2
        const blue = barHeight
        ctx.fillStyle = 'rgb(' + red + ',' + green + ',' + blue + ')'

        // const hue = i * 5
        // ctx.fillStyle = 'hsl(' + hue + ',100%, 50%)'
        

        //Create shapes
        ctx.fillRect(0, 0, barWidth, barHeight)
        x += barWidth
        ctx.restore()
    }
}